import React from 'react';

import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';

import './Nav.scss';

const Navigation = function() {
    return (
        <Navbar>
            <Container>
                <Navbar.Brand href="#">
                    <img src="https://www.develop.realtystore.com/resources/site/images/logos/logo.png" alt="brand logo" className="brand-logo" />
                </Navbar.Brand>
            </Container>
        </Navbar>
    )
}

export default Navigation;
